package com.zyc.model;

public class JuziTypeCount {
	private String leixingming;
	private Integer count;
	public JuziTypeCount() {
		super();
		// TODO Auto-generated constructor stub
	}
	public JuziTypeCount(String leixingming, Integer count) {
		super();
		this.leixingming = leixingming;
		this.count = count;
	}
	public String getLeixingming() {
		return leixingming;
	}
	public void setLeixingming(String leixingming) {
		this.leixingming = leixingming;
	}
	public Integer getCount() {
		return count;
	}
	public void setCount(Integer count) {
		this.count = count;
	}
	
}
